import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Movie Rater</h1>
        <div className="layout">
          <div> Movie list </div>
          <div> Movie list </div>
        </div>
      </header>
    </div>
  );
}

export default App;
